import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        {/* <form action="#" method="get" id="nameform">
          <label for="lname">Email:</label>
          <input type="text" id="lname" name="lname"></input>
        </form>
        <button type="submit" form="nameform" value="Submit">Subscribe(:</button> */}
        <form action="https://getsimpleform.com/messages?form_api_token=46a85efb0fa107e305373f221cb41aa2" method="post">
        {/* <!-- the redirect_to is optional, the form will redirect to the referrer on submission --> */}
        <input type='hidden' name='redirect_to' value='<the complete return url e.g. http://fooey.com/thank-you.html>' />
        {/* <!-- all your input fields here.... --> */}
        <input type='text' name='test' />
        <input type='submit' value='Test form' />
      </form>
      </header>
    </div>
  );
}

export default App;
